import Navbar from './pages/Navbar';
import Content from './pages/Content';
import './App.css';
import { useState } from 'react';

function App() {

  const [isLoading, setLoading] = useState(true);


  setTimeout(() => {
    setLoading(false)
  },3000)

  return (
    <div className='container mx-auto'>
      <Navbar />
      <Content />
    </div>
  );
}

export default App;
